	//}
	type sbResult struct {
		found bool
		nonce uint32
	}
	quit := make(chan bool)
	results := make(chan sbResult)
	solver := func(hdr wire.BlockHeader, startNonce, stopNonce uint32) {
		// We need to modify the nonce field of the header, so make sure
		// we work with a copy of the original header.
		for i := startNonce; i >= startNonce && i <= stopNonce; i++ {
			select {
			case <-quit:
				return
			default:
				//fmt.Println("Nonce = ",i)
				hdr.Nonce = i
				hash := hdr.BlockHash()
				if blockchain.HashToBig(&hash).Cmp(
					targetDifficulty) <= 0 {

					results <- sbResult{true, i}
					return
				}
			}
		}
		results <- sbResult{false, 0}
	}
	startNonce := uint32(1)
	stopNonce := uint32(math.MaxUint32)
	numCores := uint32(runtime.NumCPU())
	noncesPerCore := (stopNonce - startNonce) / numCores
	for i := uint32(0); i < numCores; i++ {
		rangeStart := startNonce + (noncesPerCore * i)
		rangeStop := startNonce + (noncesPerCore*(i+1) - 1)
		if i == numCores-1 {
			rangeStop = stopNonce
		}
		go solver(*header, rangeStart, rangeStop)
	}
	for i := uint32(0); i < numCores; i++ {
		result := <-results
		if result.found {
			close(quit)
			header.Nonce = result.nonce
			fmt.Println("----------------------------")
			fmt.Println("success!")
			fmt.Printf("%+v\n", genesisCoinbaseTxAbe)
			fmt.Printf("%+v\n", gensisBlock)
			fmt.Println("time stamp = ", header.Timestamp)
			fmt.Printf("successfule time stamp = %#x\n", header.Timestamp.Unix())
			fmt.Printf("success nonce = %#x\n", header.Nonce)
			fmt.Printf("success block hash = %#.2x\n", header.BlockHash())
			return
		}
	}

	fmt.Println("no successful nonce!")
	return

